CREATE FUNCTION sp_delete_alarm(cursorx refcursor, id_alarm integer, father_name character varying, resource integer) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	cuenta int4;
	type_point int4;
BEGIN	
	open $1 for select 0, 'Sin Error', '';
	
	if resource = 1  then
		select into cuenta count(*) from alarm where alarm_id = id_alarm;
		if cuenta > 0 then
			select into type_point point_type_id from point  where tag_name=father_name;						
			if type_point = 1 then
				delete from analog_alarm where alarm_id = id_alarm;
				delete from alarm where alarm_id = id_alarm;				
			elsif type_point = 2 then
				delete from digital_alarm where alarm_id = id_alarm;
				delete from alarm where alarm_id = id_alarm;
			end if;
		else
			close $1;
			open $1 for select -1, 'No existe la alarma', '';
		end if;
	
	elsif resource = 2  then
		select into cuenta count(*) from alarm where alarm_id = id_alarm;
		if cuenta > 0 then
			delete from device_alarm where alarm_id = id_alarm;
			delete from  alarm where alarm_id = id_alarm;			
		else
			close $1;
			open $1 for select -1, 'No existe la alarma', '';
		end if;

	elsif resource = 3  then
		select into cuenta count(*) from alarm where alarm_id = id_alarm;
		if cuenta > 0 then
			delete from subchannel_alarm where alarm_id = id_alarm;
			delete from alarm where alarm_id = id_alarm;			
		else
			close $1;
			open $1 for select -1, 'No existe la alarma', '';
		end if;
	end if;
	return $1;
EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR 
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al eliminar alarma', SQLERRM;
		return $1;
END;$_$;


