-- Name: sp_find_alarm(refcursor, integer, character varying, character varying); Type: FUNCTION; Schema: public; Owner: galba
--

CREATE FUNCTION sp_find_alarm(cursorx refcursor, resource integer, father_name character varying, alarm_type_name character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	cuenta record;
	info_resource record;
	resourse_id int4;
	type_alarm_id int4;
	id_alarm int4;
BEGIN	
	
	open $1 for select -1, ' Sin Error', '';
		select into type_alarm_id alarm_type_id	from alarm_type where alarm_type_name=alarm_type_name;
		if resource = 4  then
			select into info_resource * from point where tag_name=father_name;
			if info_resource.point_type_id = 1 then
				select into cuenta count(*) as cont from analog_alarm inner join alarm USING (alarm_id) where alarm_type_id = type_alarm_id and point_id=info_resource.point_id;
				if cuenta.cont > 0 then
					select into id_alarm alarm_id from analog_alarm inner join alarm USING (alarm_id) where alarm_type_id = type_alarm_id and point_id=info_resource.point_id;
					close $1;
					open $1 for select id_alarm, ' Sin Error', '';
					return $1;
				else 
					close $1;
					open $1 for select -1, 'No se encontro alarma', '';
					return $1;										
				end if;
			elsif info_resource.point_type_id = 2 then
				select into cuenta count(*) as cont from digital_alarm where point_id=point_id=info_resource.point_id and alarm_type_id=type_alarm_id;
				if cuenta.cont > 0 then
					select into id_alarm alarm_id from digital_alarm inner join alarm USING (alarm_id) where alarm_type_id = type_alarm_id and point_id=info_resource.point_id;
					close $1;
					open $1 for select id_alarm, ' Sin Error', '';
					return $1;
				else 
					close $1;
					open $1 for select -1, 'No se encontro alarma', '';
					return $1;										
				end if;
			else
				close $1;
				open $1 for select -1, 'No se encontro el punto '||father_name, '';
				return $1;

			end if;
			
		elsif resource = 8  then
			select into info_resource * from device where device_name=father_name;
			select into cuenta count(*) as cont1 from alarm inner join device_alarm using (alarm_id) inner join device using (device_id) where device_id=info_resource.device_id;
			if cuenta.cont1 > 0 then
				select into id_alarm alarm_id from alarm inner join device_alarm using (alarm_id) inner join device using (device_id) where device_id=info_resource.device_id;
				close $1;
				open $1 for select id_alarm, ' Sin Error', '';
				return $1;
			else 
				close $1;
				open $1 for select -1, 'No se encontro alarma', '';
				return $1;										
			end if;

		elsif resource = 7  then
			select into info_resource * from subchannel where subchannel_name=father_name;
			select into cuenta count(*) as cont1 from alarm inner join subchannel_alarm using (alarm_id) inner join subchannel using (subchannel_id) where subchannel_id=info_resource.subchannel_id;
			if cuenta.cont1 > 0 then
				select into id_alarm alarm_id from alarm inner join subchannel_alarm using (alarm_id) inner join subchannel using (subchannel_id) where subchannel_id=info_resource.subchannel_id;
				close $1;
				open $1 for select id_alarm, ' Sin Error', '';
				return $1;
			else 
				close $1;
				open $1 for select -1, 'No se encontro alarma', '';
				return $1;										
			end if;
		end if;
	return $1;
	

EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR 
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar '||name_alarm||' de '||father_name, SQLERRM;
		return $1;
	

END;$_$;


