CREATE FUNCTION sp_find_id(resource_id integer, name character varying, resource integer, resourcename character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $$DECLARE
	id int4;
	id_aux int4;
	id_module int4;
	bit_id bit varying(100);
	cuenta record;
	module_info record;
	total record;
BEGIN

----resource_id -> identificador del recurso a quien se le va a buscar el id
----name	-> nombre del modulo, cuando el resource_id=2(Modulo) el name es la descripcion del
----		   modulo para los demas es el modulo_name; en algunos casos no se requiere este campo
----		   se puede enviar blanco.
----resource	-> este parametro solo se necesita cuando se pide el identificador de una alarma, identifica
----		   el recurso de quien se quiera la alarma (punto, subcanal o dispositivo)

if resource_id =1 then --PROJECT_DATA_TYPE

	select into cuenta count(*) as cont from project;
	if cuenta.cont > 0 then
		select into id max (project_id)+1 from project;
		if id between 2228224 and 2293759 then
			return id;
		else
			return 0;
		end if;
	else
		id = 2228224;
		return id;
	end if;

else if resource_id = 2 then --MODULE_DATA_TYPE


	select into cuenta count(*) as cont from module inner join module_type using (module_type) where module_type_name = name;
	if cuenta.cont > 0 then
		select into id max (module_id)+1 from module where module_type_name = name;
		if id between 2 and 149 and name = 'RTDBModule' then --BDTR
			return id;
		else if id between 196608 and 262142 and name = 'SecurityModule' then --Seguridad
			return id;
		else if id between 720896 and 786430 and name = 'HDBModule' then --Historico
			return id;
		else if id between 458752 and 524286 and name = 'HMIModule' then --HMI
			return id;
		--Faltan los demas modulos
		else
			return 0;
		end if;
		end if;	
		end if;	
		end if;
	else
		if name = 'RTDBModule' then
			id = 2;
		else if name = 'SecurityModule' then
			id = 196608;
		else if name = 'HDBModule' then
			id = 720896;
		else if name = 'HMIModule' then
			id = 458752;
		end if;
		end if;
		end if;
		end if;
		return id;
	end if;


else if resource_id = 3 then --NODE_DATA_TYPE
	select into cuenta count(*) as cont from node;
	if cuenta.cont > 0 then
		select into id max (node_id)+1 from node;
		if id between 65536 and 131071 then
			return id;
		else
			return 0;
		end if;
	else
		id = 65536;
		return id;
	end if;

else if resource_id = 4 then --POINT_DATA_TYPE
	select into id_module module_id from module where module_name=name;
	select into cuenta count(*) as cont from point where module_id=id_module;
	if cuenta.cont > 0 then
		select into id max (point_id)+1 from point where module_id=id_module;
		select into bit_id id::bit(24);
		select into id_aux bit_id::bit(24)::integer;
		if id_aux between 3000001 and 9000000 then
			return id;
		else
			return 0;
		end if;
	else
		select into bit_id 3000001::bit(24);
		select into bit_id  id_module::bit(8) || bit_id;
		select into id bit_id::bit(32)::integer;
		return id;
	end if;

else if resource_id = 5 then --ALARM_DATA_TYPE
	if resource = 1 or resource = 2 or resource = 3 then --point, device, subchannel respectivamente
		select into id_module module_id from module where module_name=name;
		select into cuenta count(*) as cont from alarm where module_id=id_module;
		if cuenta.cont > 0 then
			select into id max (alarm_id)+1 from alarm where module_id=id_module;
			select into bit_id id::bit(24);
			select into id_aux bit_id::bit(24)::integer;
			if id_aux between 9000001 and 15000000 then
				return id;
			else
				return 0;
			end if;
		else
			select into bit_id 9000001::bit(24);
			select into bit_id  id_module::bit(8) || bit_id;
			select into id bit_id::bit(32)::integer;
			return id;
		end if;

	end if;

else if resource_id = 6 then --CHANNEL_DATA_TYPE
	select into id_module module_id from module where module_name=name;
	select into cuenta count(*) as cont from channel where module_id=id_module;
	if cuenta.cont > 0 then
		select into id max (channel_id)+1 from channel where module_id=id_module;
		select into bit_id id::bit(24);
		select into id_aux bit_id::bit(24)::integer;
		if id_aux between 1 and 1000000 then
			return id;
		else
			return 0;
		end if;
	else
		select into bit_id 1::bit(24);
		select into bit_id id_module::bit(8) || bit_id;
		select into id bit_id::bit(32)::integer;
		return id;
	end if;

else if resource_id = 7 then --SUBCHANNEL_DATA_TYPE
	select into module_info distinct module_id, module_name from  channel  inner join module using (module_id) where channel_name=name;
	--select into id_module module_id from module where module_name=name;
	select into cuenta count(*) as cont from subchannel inner join channel using (channel_id) inner join module using (module_id) where module_name=module_info.module_name;
	if cuenta.cont > 0 then
		select into id max (subchannel_id)+1 from subchannel inner join channel using (channel_id) inner join module using (module_id) where module_name=module_info.module_name;
		select into bit_id id::bit(24);
		select into id_aux bit_id::bit(24)::integer;
		if id_aux between 1000001 and 2000000 then
