CREATE FUNCTION sp_find_resource(cursorx refcursor, name character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	id int4;
	bit_id bit varying(100);
	resource_id int4;
	jj int4;
	
BEGIN

if (select count(*) from project where project_name=name) >0 then
	resource_id = 1;
	select into id project_id from project where project_name=name;
	open $1 for select resource_id,id, 'Sin Error';
	return $1;
else if (select count(*) from module where module_name=name) >0 then
	resource_id =2;
	select into id module_id from module where module_name=name;
	open $1 for select resource_id,id, 'Sin Error';
	return $1;
else if (select count(*) from node where node_name=name) >0 then
	resource_id =3;
	select into id node_id from node where node_name=name;
	open $1 for select resource_id,id, 'Sin Error';
	return $1;
else if (select count(*) from point where tag_name=name) >0 then
	resource_id =4;
	select into id point_id from point where tag_name=name;
	open $1 for select resource_id,id, 'Sin Error';
	return $1;
else if (select count(*) from channel where channel_name=name) >0 then
	resource_id = 6;
	select into id channel_id from channel where channel_name=name;
	open $1 for select resource_id,id, 'Sin Error';
	return $1;
else if (select count(*) from subchannel where subchannel_name=name) >0 then
	resource_id =7;
	select into id subchannel_id from subchannel where subchannel_name=name;
	open $1 for select resource_id,id, 'Sin Error';
	return $1;
else if (select count(*) from device where device_name=name) >0 then
	resource_id =8;
	select into id device_id from device where device_name=name;
