--
-- TOC entry 261 (class 1255 OID 16406)
-- Name: sp_get_publication_list(refcursor, integer); Type: FUNCTION; Schema: public; Owner: galba
--

CREATE FUNCTION sp_get_publication_list(cursorx refcursor, var_module_id integer) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	rst record;
	proyecto record;
	var_pub_id integer;
	resourse_type int4; -- tipo de recurso (proyecto , nodo, modulo, etc)
	resourse_name record; -- nombre del tipo de recurso en caso de modulo el typo de modulo (description)
	resourse_alarm int4; -- tipo de recurso para las alarmas (1 punto, 2 dispositivo y 3 subcanal)
	statusTime int4;
	list_id int4;
	gop_channel_id int4;
	name varchar;
	--resource varchar;


BEGIN

	delete from publication_list;
	delete from publication_list_det;

	select into resourse_name  * from module inner join module_type using (module_type)
		 where module_id=var_module_id;
	resourse_type=15;-- 15 lista
	resourse_alarm=0;
	if resourse_name.module_type_name ='RTDBModule' then

		-- Recorro los modulos del proyecto ubicado en el paso anterior
		--for rst in select module_id from node n inner join module using(node_id) where n.project_id = proyecto.project_id
		for rst in select 'lista'||transfer_frecuency as pl_name, transfer_frecuency from history inner join point_list_history using (history_id) where transfer_frecuency>0 and module_bdtr_id=var_module_id group by transfer_frecuency
		LOOP
			-- Creo el encabezado de la lista de publicacion
		select into var_pub_id sp_find_id from sp_find_id(resourse_type,resourse_name.module_name,resourse_alarm,'');
				rst.transfer_frecuency,
				17,
				resourse_name.module_id,
				var_pub_id,
				'canal'||17,
				'historico';
			-- Obtengo los registros para publicar a HDB
				var_pub_id,1
				from history inner join point_list_history using (history_id)
				where module_bdtr_id= resourse_name.module_id and
				transfer_frecuency = rst.transfer_frecuency;

		end loop;

		select into var_pub_id sp_find_id from sp_find_id(resourse_type,resourse_name.module_name,resourse_alarm,'');
				1000,
				16,
				resourse_name.module_id,
				var_pub_id,
				'canal'||16,
				'consola';

		for rst in select 'lista'||1000 as pl_name, point_id from point
		LOOP
				var_pub_id,1;--punto

		end loop;

		for rst in select 'lista'||1000 as pl_name, device_id from device
		LOOP
				var_pub_id,2; --dispositivo

		end loop;

		for rst in select 'lista'||1000 as pl_name, subchannel_id from subchannel
		LOOP
				var_pub_id,3;--subcanal
		end loop;

		for rst in select 'lista'||1000 as pl_name, channel_id from channel
		LOOP
				var_pub_id,4;--canal

		end loop;

		-- inicio publicacion canal 18
		select into var_pub_id sp_find_id from sp_find_id(resourse_type,resourse_name.module_name,resourse_alarm,'');
				1000,
				18,
				resourse_name.module_id,
				var_pub_id,
				'canal'||18,
				'opcServer';

		for rst in select 'listaCanal'||18 as pl_name, point_id from point
		LOOP
				var_pub_id,1;--punto

		end loop;

		for rst in select 'listaCanal'||18 as pl_name, device_id from device
		LOOP
				var_pub_id,2; --dispositivo

		end loop;

		for rst in select 'listaCanal'||18 as pl_name, subchannel_id from subchannel
		LOOP
				var_pub_id,3;--subcanal
		end loop;

		for rst in select 'listaCanal'||18 as pl_name, channel_id from channel
		LOOP
				var_pub_id,4;--canal

		end loop;
		--Fin de publicacion canal 18


		--creacion de listas de publicaciones por grupos operacionales (GOP).
		--for rst in select 'lista'||transfer_frecuency as pl_name, transfer_frecuency from history inner join point_list_history using (history_id) where transfer_frecuency>0 and module_bdtr_id=var_module_id group by transfer_frecuency

		gop_channel_id = 63;

		for rst in select distinct group_privilege_name as pl_name, group_privilege_id from group_privileges
		LOOP
			-- Creo el encabezado de la lista de publicacion
		select into var_pub_id sp_find_id from sp_find_id(resourse_type,resourse_name.module_name,resourse_alarm,'');
				1000, --frecuencia
				gop_channel_id, --canal
				resourse_name.module_id, --id-modulo = id-gop.
				var_pub_id, --id lista de publicacion
				rst.group_privilege_id, --nombre del canal de transferencia = id del gop.
				'Canal para el envío de información relacionada al grupo operacional: '||rst.pl_name;
			-- Obtengo los registros para publicar por los GOP

			--PUNTOS DEL GOP (id del recurso = 1) //PROPIEDAD DEL PUNTO
				var_pub_id,1
				from group_privileges inner join point using (group_privilege_id)
				where point.module_id = resourse_name.module_id and group_privilege_id = rst.group_privilege_id;	

			--DISPOSITIVOS DEL GOP-- (ID DEL RECURSO = 2) //PROPIEDAD DEL DISPOSITIVO
				var_pub_id, 2 --dispositivo
				FROM device 
				where group_privilege_id = rst.group_privilege_id;


			--CANALES DEL GOP-- (ID DEL RECURSO = 4) //PROPIEDAD DEL CANAL.
				var_pub_id, 4 --channel
				FROM channel where 
				group_privilege_id = rst.group_privilege_id;


			--SUBCANALES DEL GOP-- (ID DEL RECURSO = 3) //SE HEREDAN DEL CANAL
				var_pub_id, 3 --subchannel
				FROM subchannel inner join channel using (channel_id) 
				where group_privilege_id = rst.group_privilege_id;

			--Se incrementa el id del canal a para el próximo GOP que se configure.
			gop_channel_id = gop_channel_id + 1;

		end loop;
		--fin creacion de listas de publicaciones por grupos operacionales.


		for rst in select * from channel  where module_id = resourse_name.module_id
		LOOP
			select into statusTime min(collection_frecuency)
			from channel inner join  subchannel using(channel_id)
			inner join device using (subchannel_id) inner join point_device
			using (device_id) inner join point using (point_id)
			where channel_id=rst.channel_id;
			if (statusTime > 0) then
				select into list_id publication_list_id from publication_list where transfer_frecuency=statusTime and transfer_channel=17;
				if (list_id > 0) then
				else
					select into list_id sp_find_id from sp_find_id(resourse_type,resourse_name.module_name,resourse_alarm,'');
					select into name 'lista'||statusTime;
				end if;
			end if;

		end loop;

		for rst in select * from subchannel inner join channel using (channel_id) where module_id = resourse_name.module_id
		LOOP
			select into statusTime min(collection_frecuency) from  subchannel
			inner join device using (subchannel_id) inner join point_device using (device_id)
			inner join point using (point_id) where subchannel_id=rst.subchannel_id;

			if (statusTime > 0) then
			select into list_id publication_list_id from publication_list where transfer_frecuency=statusTime and transfer_channel=17;
				if (list_id > 0) then
				else
					select into list_id sp_find_id from sp_find_id(resourse_type,resourse_name.module_name,resourse_alarm,'');
					select into name 'lista'||statusTime;
				end if;
			end if;

		end loop;
		for rst in select * from device inner join subchannel using (subchannel_id) inner join channel using (channel_id) where module_id = resourse_name.module_id
		LOOP
			select into statusTime min(collection_frecuency) from  device
			inner join point_device using (device_id) inner join point using (point_id)
			where device_id=rst.device_id;
			if (statusTime > 0) then
				select into list_id publication_list_id from publication_list where transfer_frecuency=statusTime and transfer_channel=17;
				if (list_id > 0) then
				else
					select into list_id sp_find_id from sp_find_id(resourse_type,resourse_name.module_name,resourse_alarm,'');
					select into name 'lista'||statusTime;
				end if;
			end if;

		end loop;
	end if;

	open $1 for select * from publication_list order by transfer_frecuency, transfer_channel;
	return $1;
EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error de insercion', SQLERRM;
		return $1;

END;$_$;


