--
-- TOC entry 262 (class 1255 OID 16409)
-- Name: sp_get_resource(refcursor, character varying); Type: FUNCTION; Schema: public; Owner: galba
--

CREATE FUNCTION sp_get_resource(cursorx refcursor, var_dir_ip character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	rst record;
	proyecto record;
BEGIN
	--CREATE TABLE resource_temp (
	-- 	resource_id int4 NOT NULL DEFAULT 0,
	--	resource_name varchar(100),
	--	group_privilege_id int4 NOT NULL DEFAULT 0,
	-- 	CONSTRAINT resource_pk PRIMARY KEY (resource_id, group_privilege_id)
	--) on commit drop;

	-- Limpio los datos de la tabla "temporal"
	delete from resource_temp;

	-- Busco el proyecto al que pertenece el modulo d seguridad
	select into proyecto project_id from project p inner join node n using(project_id), module m inner join module_type mp using (module_type)
		where m.node_id = n.node_id
		and mp.module_type_name = 'SecurityModule'
		group by project_id;

	-- Recorro los modulos del proyecto ubicado en el paso anterior
	for rst in select module_id from node n inner join module using(node_id) where n.project_id = proyecto.project_id LOOP
		-- Obtengo los registros de la tabla POINT
			from point where module_id=rst.module_id;
		-- Obtengo los registros de la tabla DEVICE
			from subchannel s, channel c, device d
			where s.channel_id = c.channel_id
			and d.subchannel_id = s.subchannel_id
			and c.module_id = rst.module_id;
		-- Obtengo los registros de la tabla CHANNEL
			from channel
			where module_id=rst.module_id;

		-- Obtengo los registros de la tabla hmi_tree_node_report
			from hmi_tree_node_report
			where module_id=rst.module_id;
		-- Obtengo los registros de la tabla hmi_tree_node_screen
			from hmi_tree_node_screen
			where module_id=rst.module_id;
	end loop;

	open $1 for select * from resource_temp;
	return $1;
EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error de insercion', SQLERRM;
		return $1;

END;$_$;


