--
-- TOC entry 263 (class 1255 OID 16410)
-- Name: sp_save_alarm(refcursor, integer, character varying, character varying, character varying, real, real, real, integer, character varying, character varying, integer, integer, character varying, integer, character varying); Type: FUNCTION; Schema: public; Owner: galba
--

CREATE FUNCTION sp_save_alarm(cursorx refcursor, resource integer, name_severity character varying, name_alarm character varying, name_alarm_type character varying, value_numeric real, deadband real, priority_num real, measure_value integer, expresion_bdtr character varying, name_state character varying, bit_partner integer, numretreat integer, father_name character varying, isenable integer, expression_hmi character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	cuenta record;
	type_point int4;
	type_alarm_id int4;
	id_severity record;
	id_state int4;
	aux_id int4;
	bit_alarm int4;
	momentary int4;
	id_father int4;
	id_alarm int4;
	resourse_type int4; -- tipo de recurso (proyecto , nodo, modulo, etc)
	resourse_name varchar; -- nombre del tipo de recurso en caso de modulo el typo de modulo (description)
	resourse_alarm int4; -- tipo de recurso para las alarmas (1 punto, 2 dispositivo y 3 subcanal)
	module_info record;

	fecha timestamp;
	forze int := 0;
BEGIN

	open $1 for select 0, ' Sin Error', '';

	resourse_type=5;-- 5 alarm

		select into id_severity severity_id from severity where severity_name=name_severity;
		if name_alarm = 'LevelAlarm' then
			select into type_alarm_id alarm_type_id	from alarm_type where alarm_type_name=name_alarm_type;
		else
			select into type_alarm_id alarm_type_id	from alarm_type where alarm_type_description=name_alarm;
		end if;


		if type_alarm_id=5 or type_alarm_id=6 or type_alarm_id=10 then
			momentary := 1;
		else
			momentary := 0;
		end if;

		if resource = 4  then

			resourse_alarm=1;
			select into module_info * from point inner join module using (module_id) where tag_name=father_name;
			select into id_father point_id from point where tag_name=father_name;
			select into type_point point_type_id from point where tag_name=father_name;
			resourse_name=module_info.module_name;

			if type_point = 1 or type_point = 3  then
				select into cuenta count(*) as cont from analog_alarm inner join alarm USING (alarm_id) where alarm_type_id = type_alarm_id and point_id=id_father;

				if cuenta.cont > 0 then

					select into id_alarm alarm_id from analog_alarm inner join alarm USING (alarm_id) where alarm_type_id = type_alarm_id and point_id=id_father;

					update alarm set  severity_id=id_severity.severity_id , priority=priority_num,
						is_momentary=momentary, is_enabled=isenable
						where alarm_id = id_alarm;

					update analog_alarm set numeric_value = value_numeric,alarm_deadband = deadband,measure_unit=measure_value, expression_name=expresion_bdtr ,expression=expression_hmi
						where alarm_id = id_alarm and point_id=id_father;

				else
					select into id_alarm sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm, name_alarm);
							deadband, measure_value,expression_hmi, expresion_bdtr);

				end if;

			elsif type_point = 2 or type_point = 4 then
				if type_alarm_id = 7 then
					select into id_state state_id from state where state_name=name_state;
					select  into bit_alarm bit_partner_state from point_state where state_id=id_state and point_id=id_father;
					select into cuenta count(*) as cont from digital_alarm where state_id=id_state and point_id=id_father and bit_partner_alarm=bit_alarm;

					if cuenta.cont > 0 then

						select into id_alarm alarm_id from digital_alarm inner join alarm USING (alarm_id) where state_id=id_state and point_id=id_father and bit_partner_alarm=bit_alarm;

						update alarm set  severity_id=id_severity.severity_id , priority=priority_num,
							is_momentary=momentary,is_enabled=isenable
							where alarm_id = id_alarm;

					else
						select into id_alarm sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm, name_alarm);

					end if;
				else

					select into cuenta count(*) as cont from digital_alarm where point_id=id_father and alarm_type_id=type_alarm_id;

					if cuenta.cont > 0 then

						select into id_alarm alarm_id from digital_alarm inner join alarm USING (alarm_id)  where point_id=id_father and alarm_type_id=type_alarm_id;

						update alarm set  severity_id=id_severity.severity_id , priority=priority_num,
							is_momentary=momentary,is_enabled=isenable
							where alarm_id = id_alarm;

					else
						select into id_alarm sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm,name_alarm);

					end if;
				end if;
			else
				close $1;
				open $1 for select 0, 'No se encontro el punto '||father_name, '';

			end if;

		elsif resource = 8  then

			resourse_alarm=2;
			select into module_info * from device inner join subchannel using (subchannel_id) inner join channel using (channel_id) inner join module using (module_id) where device_name=father_name;
			select into id_father device_id from device where device_name=father_name;
			resourse_name=module_info.module_name;

			select into cuenta count(*) as cont1 from alarm inner join device_alarm using (alarm_id) inner join device using (device_id) where device_name=father_name;
			if cuenta.cont1 > 0 then
				select into id_alarm alarm_id from alarm inner join device_alarm using (alarm_id) inner join device using (device_id) where device_name=father_name;
				update alarm set  severity_id=id_severity.severity_id , priority=priority_num,
						alarm_description=name_alarm, is_momentary=momentary,is_enabled=isenable
						where alarm_id = id_alarm;
				update device_alarm set retreat = numretreat
						where alarm_id = id_alarm and device_id=id_father;

			else
				select into id_alarm sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm, name_alarm);

			end if;

		elsif resource = 7  then
			resourse_alarm=3;
			select into module_info * from subchannel  inner join channel using (channel_id) inner join module using (module_id) where subchannel_name=father_name;
			select into id_father subchannel_id from subchannel where subchannel_name=father_name;
			resourse_name=module_info.module_name;


			select into cuenta count(*) as cont1 from alarm inner join subchannel_alarm using (alarm_id) inner join subchannel using (subchannel_id) where subchannel_name=father_name;
			if cuenta.cont1 > 0 then
				select into id_alarm alarm_id from alarm inner join subchannel_alarm using (alarm_id) inner join subchannel using (subchannel_id) where subchannel_name=father_name;
				update alarm set  severity_id=id_severity.severity_id , priority=priority_num,
						alarm_description=name_alarm, is_momentary=momentary,is_enabled=isenable
						where alarm_id = id_father and module_id= module_info.module_id;
				update subchannel_alarm set retreat = numretreat
						where alarm_id = id_alarm and subchannel_id=id_father;

			else
				select into id_alarm sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm, name_alarm);

			end if;
		end if;
	return $1;


EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar '||name_alarm||' de '||father_name, SQLERRM;
		return $1;


END;$_$;


