CREATE FUNCTION sp_save_analog_point(cursorx refcursor, action_id integer, id integer, name character varying, id_poin_type integer, name_operation_mode character varying, id_user integer, name_group_privilege character varying, frecuency bigint, name_type_data character varying, description character varying, avalanche integer, address_in character varying, address_out character varying, deadband real, limit_in_up_raw real, limit_in_low_raw real, limit_in_up_egu real, limit_in_low_egu real, linialized_in integer, unit_in character varying, out_time real, limit_out_up_raw real, limit_out_low_raw real, limit_out_up_egu real, limit_out_low_egu real, time_transf real, linialized_out integer, setpoint_min real, setpoint_max real, processing_in character varying, processing_out character varying, name_module character varying, name_device character varying, name_history character varying, id_data_type_scada integer, initialvalue real) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE

	cuenta record;
	total record;
	modo record;

	type_data int;
	fecha timestamp;
	forze int := 0;
	list int;
--	linial_out int;
--	linial_in int;
	--value float := 50;
	b_in float;
	m_in float;
	b_out float;
	m_out float;
	id_data_type int4;
	id_data_type_scada int4;
	outputaddress varchar;-- := address_out;
	inputaddress varchar ;--:= address_in;
	processingValue int;
	historypoint_cont int;
	devicepoint_cont int;
	history_cont int;
	device_cont int;
	id_history int4;
	module_info record;
	id_device int4;
	id_point int4;
	id_group int4;
	resourse_type int4; -- tipo de recurso (proyecto , nodo, modulo, etc)
	resourse_name varchar; -- nombre del tipo de recurso en caso de modulo el typo de modulo (description)
	resourse_alarm int4; -- tipo de recurso para las alarmas (1 punto, 2 dispositivo y 3 subcanal)
   protocolName character varying;


BEGIN
	open $1 for select 0, 'Sin Error', '';
   --select  protocolName = (select comm_protocol_name from comunication_protocol where comm_protocol_id = (select comm_protocol_id from subchannel where subchannel_id = (select subchannel_id from device where device_id = (select device_id from point_device where point_id=36564436))));


	select into module_info * from module where module_name=name_module;
	select into id_group group_privilege_id from group_privileges where group_privilege_name=name_group_privilege;

	select into  history_cont count(*) from history where history_name=name_history;

	select into device_cont count(*) from device where device_name=name_device;

	resourse_type=4;-- 4 punto
	resourse_name=module_info.module_name;
	resourse_alarm=0;

	select into cuenta count(*) as cont from point where tag_name=name;
	select into fecha now();
	select into modo  *from operation_mode where operation_mode_name=name_operation_mode;
	select into id_data_type data_type_id from data_type where data_type_name=name_type_data;

--	if id_data_type = 0 or id_data_type=1 or id_data_type=2 or id_data_type=3 or id_data_type=4
--		or id_data_type=5 or id_data_type=6 or id_data_type=7	then
--		id_data_type_scada := 2;
--	elsif id_data_type=8 or id_data_type=9 then
--		id_data_type_scada := 3;
--	end if;

-- se quedo en reunion de mesa para el pto analogico el data_type_scada_id = 3 double
	id_data_type_scada := 3;

	if address_in<>'' and address_out<>'' then
		processingValue=2;
		outputaddress := address_out;
		inputaddress := address_in;
	elsif address_in<>'' then
		outputaddress := '';
		inputaddress := address_in;
		processingValue=1;

	elsif address_out<>'' then
		outputaddress :=  address_out;
		inputaddress := '';
		processingValue=0;
	end if;

	if linialized_in = 1 and (limit_in_up_raw-limit_in_low_raw) <> 0  then
		m_in:=(limit_in_up_egu-limit_in_low_egu)/(limit_in_up_raw-limit_in_low_raw);
		b_in:= limit_in_up_egu - (limit_in_up_raw*m_in);

	else
		m_in:=1;
		b_in:=0;

	end if;

	if linialized_out = 1 and (limit_out_up_raw-limit_out_low_raw)<>0 then
		m_out:=(limit_out_up_raw-limit_out_low_raw)/(limit_out_up_egu-limit_out_low_egu);
		b_out:= limit_out_up_raw - (limit_out_up_egu*m_out);

	else
		m_out:=1;
		b_out:=0;

	end if;

	if action_id=1 then
		if cuenta.cont > 0 then
			close $1;
			open $1 for select -1, 'Error al insertar el punto '||name||', ya existe', 'Punto ya existe';
			return $1;
		else
			--select into id_point sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm);
			select into id_point sp_find_id_point from sp_find_id_point(name,resourse_name);

				frecuency, id_data_type, forze, description, avalanche, module_info.module_id, out_time, time_transf,
				deadband, inputaddress, outputaddress,processingValue,id_data_type_scada,processing_in,processing_out);

				limit_in_low_egu,linialized_in, unit_in);

				 setpoint_min,setpoint_max,limit_out_up_egu, limit_out_low_egu);

			if  history_cont> 0 then
				select into id_history history_id from history where history_name=name_history;
			end if;
			if  device_cont> 0 then
				select into id_device device_id from device where device_name=name_device;
			end if;
         
			select into protocolName comm_protocol_name from comunication_protocol where comm_protocol_id = (select comm_protocol_id from subchannel where subchannel_id = (select subchannel_id from device where device_id = (select device_id from point_device where point_id=id_point)));
			if protocolName = 'VirtualManual' then
				update point set processing_type_value = 3 where point_id = id_point;
			end if;
			--RAISE INFO ' protocolo %   ',  protocolName ;

		end if;
	elsif action_id=2 then
		if cuenta.cont > 0 then
			select into id_point point_id from point where tag_name=name;
			select into historypoint_cont count(*) from point_list_history where point_id=id_point;
			select into devicepoint_cont count(*) from point_device where point_id=id_point;

			update point set point_id=id_point, point_type_id=id_poin_type, operation_mode_id=modo.operation_mode_id,user_id=id_user,
				point_modification_date=fecha, group_privilege_id=id_group,collection_frecuency=frecuency,
				data_type_id=id_data_type, is_forzed=forze, point_description=description, is_avalanche_enabled=avalanche,
				module_id=module_info.module_id, processing_type_value=processingValue, time_out=out_time,transfer_time=time_transf,
				point_deadband=deadband,input_address=inputaddress, output_address=outputaddress, data_scada_type_id=id_data_type_scada,
				input_processing_type_name=processing_in,output_processing_type_name=processing_out
				where tag_name=name;

			update analog_point set point_id=id_point, initial_value=initialValue,  b_input=b_in, m_input=m_in, in_upper_limit_raw=limit_in_up_raw,
				in_lower_limit_raw=limit_in_low_raw, in_upper_limit_egu=limit_in_up_egu, in_lower_limit_egu=limit_in_low_egu,
				is_linealized_in=linialized_in, units_in_name=unit_in
				where point_id=id_point;

			update analog_control set  point_id=id_point, out_upper_limit_raw=limit_out_up_raw, out_lower_limit_raw=limit_out_low_raw,
				out_upper_limit_egu=limit_out_up_egu, out_lower_limit_egu=limit_out_low_egu, b_output=b_out,
				m_output=m_out,  is_linealized_out=linialized_out, min_setpoint_egu=setpoint_min,
				max_setpoint_egu=setpoint_max
				where point_id=id_point;
			if  history_cont<> 0  then
				select into id_history history_id from history where history_name=name_history;
				if historypoint_cont>0 then
					update point_list_history set  history_id=id_history,module_bdtr_id= module_info.module_id where point_id=id_point;
				else
				end if;
			end if;

			if  device_cont<> 0  then
				select into id_device device_id from device where device_name=name_device;
				if devicepoint_cont>0 then
					update point_device set  device_id=id_device where point_id=id_point;
				else
				end if;
			end if;

         select into protocolName comm_protocol_name from comunication_protocol where comm_protocol_id = (select comm_protocol_id from subchannel where subchannel_id = (select subchannel_id from device where device_id = (select device_id from point_device where point_id=id_point)));
			if protocolName = 'VirtualManual' then
				update point set processing_type_value = 3 where point_id = id_point;
			end if;
			--RAISE INFO ' protocolo %   ',  protocolName ;
		else
			close $1;
			open $1 for select -1, 'Error al actualizar el punto '||name||', no existe', 'Punto ya existe';
			return $1;
		end if;
	else
		close $1;
		open $1 for select -1, 'Error al configurar el punto '||name, 'Accion no valida';
		return $1;
	end if;


	return $1;

EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar el punto '||name, SQLERRM;
		return $1;
END;$_$;


