CREATE FUNCTION sp_save_calculate(cursorx refcursor, action_id integer, name character varying, id_poin_type integer, name_operation_mode character varying, id_user integer, name_group_privilege character varying, frecuency bigint, name_type_data character varying, description character varying, deadband real, limit_up real, limit_low real, name_module character varying, name_history character varying, expresion_hmi character varying, expresion_bdtr character varying, expresion_logica_hmi character varying, expresion_logica_bdtr character varying, initial_val double precision, initial_st integer, num_bits integer, cal_type integer, timeunits character varying, activationmode character varying, id_data_type_scada integer) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE

	cuenta record;
	total record;
	modo record;
	type_data int;
	fecha timestamp;
	list int;
	id_data_type int4;
	id_data_type_scada int4;
	historypoint_cont int;
	history_cont int;
	id_history int4;
	module_info record;
	id_point int4;
	id_group int4;
	resourse_type int4; -- tipo de recurso (proyecto , nodo, modulo, etc)
	resourse_name varchar; -- nombre del tipo de recurso en caso de modulo el typo de modulo (description)
	resourse_alarm int4; -- tipo de recurso para las alarmas (1 punto, 2 dispositivo y 3 subcanal)



BEGIN
	open $1 for select 0, 'Sin Error', '';


	select into module_info * from module where module_name=name_module;
	select into id_group group_privilege_id from group_privileges where group_privilege_name=name_group_privilege;

	select into  history_cont count(*) from history where history_name=name_history;

	resourse_type=4;-- 4 punto
	resourse_name=module_info.module_name;
	resourse_alarm=0;

	select into cuenta count(*) as cont from point where tag_name=name;
	select into fecha now();
	select into modo  *from operation_mode where operation_mode_name=name_operation_mode;
	select into id_data_type data_type_id from data_type where data_type_name=name_type_data;

	if id_poin_type = 3 then -- Es punto analogico calculado
        id_data_type_scada := 3;
    else -- Es un punto digital calculado
    	id_data_type_scada := 1;
    end if;

	if action_id=1 then
		if cuenta.cont > 0 then
			close $1;
			open $1 for select -1, 'Error al insertar el punto '||name, 'Punto ya existe';
			return $1;
		else
			--select into id_point sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm);
			select into id_point sp_find_id_point from sp_find_id_point(name,resourse_name);
				0, id_data_type, 0, description, 0, module_info.module_id, 0, 0,
				deadband, '', '',5,id_data_type_scada,'','');

				initial_val,initial_st,cal_type,limit_low,limit_up,num_bits,
				expresion_hmi,expresion_logica_bdtr,timeUnits,activationMode);


			if  history_cont> 0 then
				select into id_history history_id from history where history_name=name_history;
			end if;
		end if;
	elsif action_id=2 then
		if cuenta.cont > 0 then
			select into id_point point_id from point where tag_name=name;
			select into historypoint_cont count(*) from point_list_history where point_id=id_point;

			update point set point_id=id_point, point_type_id=id_poin_type, operation_mode_id=modo.operation_mode_id,user_id=id_user,
				point_modification_date=fecha, group_privilege_id=id_group,collection_frecuency=0,
				data_type_id=id_data_type, is_forzed=0, point_description=description, is_avalanche_enabled=0,
				module_id=module_info.module_id, processing_type_value=5, time_out=0,transfer_time=0,
				point_deadband=deadband, data_scada_type_id=id_data_type_scada
				where tag_name=name;

			update  calculate_point set point_id=id_point, logical_expresion=expresion_logica_hmi, expresion=expresion_bdtr,
				calculation_frequency=frecuency, incial_value=initial_val, inicial_state=initial_st,
				calculate_type=cal_type , inlower=limit_low, inupper=limit_up, count_bits=num_bits,
				calculated_expresion=expresion_hmi, logical_expresion_inf=expresion_logica_bdtr,
				time_units =timeUnits,activation_mode=activationMode
				where tag_name=name;

			if  history_cont<> 0  then
				select into id_history history_id from history where history_name=name_history;
				if historypoint_cont>0 then
					update point_list_history set  history_id=id_history,module_bdtr_id= module_info.module_id where point_id=id_point;
				else
				end if;
			end if;
		else
			close $1;
			open $1 for select -1, 'Error al actualizar el punto '||name, 'Punto ya existe';
			return $1;
		end if;
	else
		close $1;
		open $1 for select -1, 'Error al configurar el punto '||name, 'Accion no valida';
		return $1;
	end if;


	return $1;

EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar el punto '||name, SQLERRM;
		return $1;
END;$_$;


