CREATE FUNCTION sp_save_digital_control(cursorx refcursor, num_segment integer, name_point character varying, name_control character varying, control_value integer, inicial_value integer) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	control_cont record;
	cuenta record;
	controlId int;
	total record;
	bit_par record;
	id_point int4;
	control_id int4;

BEGIN
	open $1 for select 0, 'Sin Error', '';
	select into total count (*) as cont from  control_action;
	select into id_point point_id from point where tag_name=name_point;
	select into control_cont count(*) as cont from control_action where control_action_name=name_control;
	select into control_id control_action_id from control_action where control_action_name=name_control;


	if name_control='' then
		select into  bit_par count(*) as cont from point_action_by_segment where point_id=id_point and segment=num_segment and value=control_value ;

		if control_cont.cont > 0 then
			select into control_cont * from control_action where control_action_name=name_control;
		else
			if total.cont = 0 then
				controlId:=1;
			else
				select into controlId max(control_action_id)+1 from control_action;
			end if;
			select into control_cont * from control_action where control_action_name=name_control;
		end if;

		if bit_par.cont > 0 then
			update point_action_by_segment set control_action_id=control_cont.control_action_id, state_return=inicial_value where point_id=id_point and segment=num_segment and value=control_value;

		else
		end if;
	else

		select into  bit_par count(*) as cont from point_action_by_segment where point_id=id_point and segment=num_segment and control_action_id=control_id;


		if control_cont.cont > 0 then
			select into control_cont * from control_action where control_action_name=name_control;
		else
			if total.cont = 0 then
				controlId:=1;
			else
				select into controlId max(control_action_id)+1 from control_action;
			end if;
			select into control_cont * from control_action where control_action_name=name_control;
		end if;

		if bit_par.cont > 0 then
			update point_action_by_segment set control_action_id=control_cont.control_action_id, value=control_value,state_return=inicial_value where point_id=id_point and segment=num_segment and control_action_id=control_cont.control_action_id;

		else
		end if;
	end if;


	return $1;

EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar acciones de control del punto '||name_point, SQLERRM;
		return $1;
END;$_$;


ALTER FUNCTION public.sp_save_digital_control(cursorx refcursor, num_segment integer, name_point character varying, name_control character varying, control_value integer, inicial_value integer) OWNER TO galba;

