CREATE FUNCTION sp_save_digital_inputsegment(cursorx refcursor, point_bit integer, name_point character varying, input_direction character varying, bit_partner integer, number_bit integer, processing character varying, processing_point integer) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	cuenta record;
	bit_cont_id record;
	total record;
	bitId int;
	processingId int;
	id_point int;
   protocolName character varying;

BEGIN
	open $1 for select 0, 'Sin Error', '';
	select into id_point point_id from point where tag_name=name_point;
	select into cuenta count(*) as cont from segment_in where point_id=id_point and segment=point_bit;
	--select into processingId processing_type_id from processing_type where processing_type_name=processing;
	
	select into protocolName comm_protocol_name from comunication_protocol where comm_protocol_id = (select comm_protocol_id from subchannel where subchannel_id = (select subchannel_id from device where device_id = (select device_id from point_device where point_id=id_point)));
	if protocolName = 'VirtualManual' then
		update point set processing_type_value = 3 where point_id = id_point;
	else
		update point set processing_type_value=processing_point where point_id=id_point;
	end if;
	--RAISE INFO ' protocolo %   ',  protocolName ;
	if cuenta.cont > 0  then
		update segment_in set input_address=input_direction, input_associate_bit=bit_partner, number_bit_in=number_bit, processing_type_name=processing where point_id=id_point and segment=point_bit;
	else
	end if;
	return $1;

EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar direcciones de entrada del punto '||name_point, SQLERRM;
		return $1;
END;$_$;


