-- Name: sp_save_digital_point(refcursor, integer, integer, character varying, integer, character varying, integer, character varying, bigint, character varying, integer, integer, integer, real, character varying, real, real, character varying, character varying, character varying, integer, integer, integer, character varying, integer, integer, integer, integer); Type: FUNCTION; Schema: public; Owner: galba
