CREATE FUNCTION sp_save_group_privileges(cursorx refcursor, action_id integer, var_group_id integer, var_name_group character varying, description character varying, var_module_id integer, father_name character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	cuenta record;
	resourse_type int4; -- tipo de recurso (proyecto , nodo, modulo, etc)
	resourse_name varchar; -- nombre del tipo de recurso en caso de modulo el typo de modulo (description)
	resourse_alarm int4; -- tipo de recurso para las alarmas (1 punto, 2 dispositivo y 3 subcanal)
	id_group_privileges int4;
	id_father int4;

BEGIN
	open $1 for select 0, 'Sin Error', '';
	resourse_type=12;-- 12 grupo de privileguios
	resourse_name='';
	resourse_alarm=0;
	select into cuenta count(*) as cont from group_privileges where group_privilege_name= var_name_group;

	if action_id =1 then
		if cuenta.cont > 0 then
			close $1;
			open $1 for select -1, 'Error al insertar el grupo '||var_user_name||', ya existe', 'Usuario ya existe';
			return $1;
		else
			select into id_father module_id from module where module_name=father_name;
			select into id_group_privileges sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm, var_name_group);
		end if;
	elsif action_id =2 then
		if cuenta.cont > 0 then
			select into id_group_privileges group_privilege_id from group_privileges where group_privilege_name= var_name_group;
			select into id_father module_id from group_privileges where group_privilege_name= var_name_group;
			update group_privileges set group_privilege_id=id_group_privileges ,
				group_privilege_description=description,
				module_id = id_father
				where group_privilege_name=var_name_group;
		else
			close $1;
			open $1 for select -1, 'Error al actualizar el grupo '||var_user_name||', no existe', 'Usuario no existe';
			return $1;
		end if;
	else
		close $1;
		open $1 for select -1, 'Error al configurar el grupo '||var_user_name, 'Accion no valida';
		return $1;
	end if;
	return $1;

EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar el grupo operacional '||var_name_group, SQLERRM;
		return $1;
END;$_$;


