CREATE FUNCTION sp_save_history(ref refcursor, action_id integer, id integer, name character varying, transfertypeid integer, transferfrequency integer, deadband double precision, mod_id integer, description character varying, var_storage_name character varying, var_point_type_name character varying, father_name character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	cuenta record;
	deadBand_value float8;
	transferFre_value int4;
	var_storage_id int4;
	var_point_type_id int4;
	resourse_type int4; -- tipo de recurso (proyecto , nodo, modulo, etc)
	resourse_name varchar; -- nombre del tipo de recurso en caso de modulo el typo de modulo (description)
	resourse_alarm int4; -- tipo de recurso para las alarmas (1 punto, 2 dispositivo y 3 subcanal)
	id_history int4;
	id_father int4;

BEGIN
	open $1 for select 0, 'Sin Error', '';
	select into cuenta count(*) as cont from history where history_name=name;

	-- Ubico el codigo del "storage"
	select into var_storage_id storage_id from storage where storage_description=var_storage_name;

	-- Ubico el codigo del "storage"
	select into var_point_type_id point_type_id from point_type where point_type_description=var_point_type_name;

	if transferTypeId = 0 then
		deadBand_value := -1;
		transferFre_value:= transferFrequency;
	elsif transferTypeId = 1 then
		transferFre_value := -1;
		deadBand_value := deadBand;
	elsif transferTypeId = 2 then
		transferFre_value := -1;
		deadBand_value := -1;
	end if;
	resourse_type=10;-- 10 HISTORICO
	resourse_name='';
	resourse_alarm=0;

	if action_id=1 then
		if cuenta.cont > 0 then
			close $1;
			open $1 for select -1, 'Error al insertar el historico '||name||', ya existe','Historico ya existe';
			return $1;
		else
			select into id_father module_id from module where module_name=father_name;
			select into id_history sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm, name);
			transferFre_value,deadBand_value,id_father, 2,
			description, var_storage_id, var_point_type_id );
		end if;
	elsif action_id=2 then
		if cuenta.cont > 0 then
			select into id_history history_id from history where history_name= name;
		select into id_father module_id from history where history_name= name;
		update history set history_id=id_history,
			transfer_type_id=transferTypeId,
			transfer_frecuency=transferFre_value,
			history_deadband=deadBand_value,
			module_id=id_father,
			history_description=description,
			storage_id = var_storage_id,
			point_type_id = var_point_type_id
			where history_name=name;
		else
			close $1;
			open $1 for select -1, 'Error al actualizar el historico '||name ||', no existe','Historico no existe';
			return $1;
		end if;
	else
		close $1;
		open $1 for select -1, 'Error al configurar el historico '||name,'Accion no definida';
		return $1;

	end if;
	return $1;

 	EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar el historico '||name, SQLERRM;
		return $1;
END;$_$;


