--
-- TOC entry 300 (class 1255 OID 16437)
-- Name: sp_save_module(refcursor, integer, integer, character varying, character varying, integer, character varying, character varying); Type: FUNCTION; Schema: public; Owner: galba
--

CREATE FUNCTION sp_save_module(cursorx refcursor, action_id integer, id integer, name character varying, description_module character varying, id_node integer, father_name character varying, typemodule character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	cuenta record;
	resourse_type int4; -- tipo de recurso (proyecto , nodo, modulo, etc)
	resourse_name varchar; -- nombre del tipo de recurso en caso de modulo el typo de modulo (description)
	resourse_alarm int4; -- tipo de recurso para las alarmas (1 punto, 2 dispositivo y 3 subcanal)
	id_module int4;
	id_father int4;
	id_type int4;
	cantidad_module_hmi int4;
BEGIN
	open $1 for select 0, 'Sin Error', '';
	-- Seteo de modulo HMI, donde se inserta o modifica el id de modulo.
	
	
	select into id_type module_type from module_type where module_type_name=typemodule;
	if id_type = 3 then
		delete from module where module_type = 3;
	else
		cantidad_module_hmi = (select count(*) from module where module_type = 3);
		if cantidad_module_hmi = 0 then
			values(458752,'HMI','',65536,3);
		end if;
	end if;
	select into cuenta count(*) as cont from module where module_name=name;
	select into resourse_name module_type from module where module_name=name;
	resourse_type=2;-- 2 modulo
	resourse_alarm=0;

	if action_id=1 then
		if cuenta.cont > 0 then
			close $1;
			open $1 for select -1, 'Error al insertar el modulo '||name||', ya existe', 'Modulo ya existe';
			return $1;
		else
			resourse_name=typemodule;
			select into id_module sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm, name);
			select into id_father node_id from node where node_name=father_name;
		end if;
	elsif action_id=2 then
		if cuenta.cont > 0 then
			select into id_module module_id from module where module_name=name;
			select into id_father node_id from node where node_name=father_name;
			update module set module_id=id_module,description=description_module,node_id=id_father where module_name=name;
		else
			close $1;
			open $1 for select -1, 'Error al actualizar el modulo '||name||', no existe', 'Modulo no existe';
			return $1;
		end if;
	else
		close $1;
		open $1 for select -1, 'Error al insertar el modulo'||name, 'Action no definida';
		return $1;
	end if;
	
	return $1;

EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar el modulo'||name, SQLERRM;
		return $1;
END;$_$;


