--
-- TOC entry 279 (class 1255 OID 16439)
-- Name: sp_save_operational_point(refcursor, integer, character varying, real); Type: FUNCTION; Schema: public; Owner: galba
--

CREATE FUNCTION sp_save_operational_point(cursorx refcursor, action_id integer, point_name character varying, point_value real) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	cuenta record;
	cuentaAnalogico record;
	cuentaDigital record;
	idPoint integer;
	direccion character varying;
	inputAddressCursor refcursor;
	inputAddress character varying;
BEGIN
	open $1 for select 0, 'Sin Error', '';

	select into cuenta count(*) as cont from point where tag_name=point_name;
	if cuenta.cont > 0 then

		  select into idPoint point_id from point where tag_name like point_name;
		  select into cuentaAnalogico count(*) as cont from analog_point where point_id=idPoint;
		  select into cuentaDigital count(*) as cont from digital_point where point_id=idPoint;
		  if cuentaAnalogico.cont > 0 then
			 update analog_point set initial_value = point_value where point_id = idPoint;
			 select into direccion input_address from point where point_id = idPoint;
			 update point set input_address = (select substring(direccion from 0 for strpos(direccion, '@')) || '@' || point_value) where point_id = idPoint;
		  end if;
		  if cuentaDigital.cont > 0 then
			 update digital_point set initial_state = point_value where point_id = idPoint;
			  --declare subcanalCursor CURSOR FOR select input_address from segment_in where point_id = idPoint;
			 -- segment_in hacer cursor
			 OPEN inputAddressCursor for select input_address from segment_in where point_id = idPoint;
			 FETCH NEXT from inputAddressCursor INTO inputAddress;
				while(FOUND)
				LOOP
					update segment_in set input_address = (select substring(inputAddress from 0 for strpos(inputAddress, '@')) || '@' || point_value) where input_address like inputAddress;
					FETCH NEXT from inputAddressCursor INTO inputAddress;
				END LOOP;
				CLOSE inputAddressCursor;	

		end if;
		   
	else
		close $1;
               open $1 for select -1, 'Error al actualizar el punto '||point_name||', no existe', 'El punto no existe';
               return $1;
	end if;


	return $1;

EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error', SQLERRM;
		return $1;

END;$_$;


ALTER FUNCTION public.sp_save_operational_point(cursorx refcursor, action_id integer, point_name character varying, point_value real) OWNER TO galba;

