CREATE FUNCTION sp_save_parameter(cursorx refcursor, id_entity integer, table_name character varying, value_parameter character varying, name_parameter character varying, father_name character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	parameter_cont record;
	cuenta record;
	parameterId int4;
	total record;
	driver_info int4;
	id_father int4;

BEGIN
	open $1 for select 0, 'Sin Error', '';

	if table_name='channel' then
		select into total count (*) as cont from channel_parameter;
		select into id_father channel_id from channel where channel_name=father_name;
		select into parameter_cont count(*) as cont from channel_parameter
