--

CREATE FUNCTION sp_save_profile(cursorx refcursor, action_id integer, var_profile_id integer, var_profile_name character varying, var_expiration_time integer, var_is_extended integer, var_days integer, var_module_id integer, father_name character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	cuenta record;
	resourse_type int4; -- tipo de recurso (proyecto , nodo, modulo, etc)
	resourse_name varchar; -- nombre del tipo de recurso en caso de modulo el typo de modulo (description)
	resourse_alarm int4; -- tipo de recurso para las alarmas (1 punto, 2 dispositivo y 3 subcanal)
	id_profile int4;
	id_father int4;
BEGIN
	open $1 for select 0, 'Sin Error', '';
	resourse_type=13;-- 13 perfiles
	resourse_name='';
	resourse_alarm=0;
	select into id_father module_id from module where module_name=father_name;
	select into cuenta count(*) as cont from tprofiles where profile_name=var_profile_name;

	if action_id=1 then
		if cuenta.cont > 0 then
			close $1;
			open $1 for select -1, 'Error al insertar el perfil'||var_profile_name||', ya existe', 'Perfil ya existe';
			return $1;
		else
			select into id_profile sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm, var_profile_name);
		end if;
	elsif action_id=2 then
		if cuenta.cont > 0 then
			select into id_profile profile_id from tprofiles where profile_name=var_profile_name;

			update tprofiles set module_id=id_father,
				profile_id=id_profile,
				session_time=var_expiration_time,
				days=var_days,
				is_extended=var_is_extended
				where profile_name=var_profile_name;
		else
			close $1;
			open $1 for select -1, 'Error al actualizar el perfil'||var_profile_name||', no existe', 'Perfil no existe';
			return $1;
		end if;
	else
		close $1;
		open $1 for select -1, 'Error al configurar el perfil'||var_profile_name, 'Accion no valida';
		return $1;
	end if;
	return $1;

EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar el perfil '||var_profile_name, SQLERRM;
		return $1;

END;$_$;


