CREATE FUNCTION sp_save_project(cursorx refcursor, action_id integer, id integer, name character varying, description character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	cuenta record;
	id_project int4;
	resource_type int4;
	resource int4;

BEGIN
	open $1 for select 0, 'Sin Error', '';
	select into cuenta count(*) as cont from project where project_name=name;
	resource_type:= 1;
	resource = 0;

	if action_id=1 then
		if cuenta.cont > 0 then
			close $1;
			open $1 for select -1, 'Error al insertar el proyecto '||name||', ya existe', 'Proyecto ya existe';
			return $1;
		else
			select into id_project sp_find_id from sp_find_id(resource_type,'',resource, name);
		end if;
	elsif action_id=2 then
		if cuenta.cont > 0 then
			select into id_project project_id from project where project_name=name;
			update project set project_id=id_project,project_description=description where project_name=name;
		else
			close $1;
			open $1 for select -1, 'Error al actualizar el proyecto '||name||', no existe', 'Proyecto no existe en la BD';
			return $1;
		end if;
	else
		close $1;
		open $1 for select -1, 'Error al insertar el proyecto '||name, 'Accion no definida';
		return $1;

	end if;
	return $1;

EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar el proyecto '||name, SQLERRM;
		return $1;

END;$_$;


