CREATE FUNCTION sp_save_subchannel(cursorx refcursor, action_id integer, id integer, name character varying, description character varying, id_user integer, protocol_name character varying, id_channel integer, name_driver character varying, type_query character varying, father_name character varying) RETURNS refcursor
    LANGUAGE plpgsql
    AS $_$DECLARE
	cuenta record;
	protocolo record;
	fecha timestamp;
	driver_info record;
	resourse_type int4; -- tipo de recurso (proyecto , nodo, modulo, etc)
	resourse_name varchar; -- nombre del tipo de recurso en caso de modulo el typo de modulo (description)
	resourse_alarm int4; -- tipo de recurso para las alarmas (1 punto, 2 dispositivo y 3 subcanal)
	id_father int4;
	id_subchannel int4;

BEGIN
	open $1 for select 0, 'Sin Error', '';
	select into cuenta count(*) as cont from subchannel where subchannel_name=name;
	select into fecha now();
	select into protocolo *from comunication_protocol where comm_protocol_name=protocol_name;
	select into driver_info *from driver where driver_description=protocol_name;
	select into id_father channel_id from channel where channel_name=father_name;

	resourse_type=7;-- 7 Subchannel
	resourse_name=father_name;
	resourse_alarm=0;

	if action_id=1 then
		if cuenta.cont > 0 then
			close $1;
			open $1 for select -1, 'Error al insertar el subcanal '||name||', ya existe', 'El subcanal ya existe';
			return $1;
		else
			select into id_subchannel sp_find_id from sp_find_id(resourse_type,resourse_name,resourse_alarm, name);
		end if;
	elsif action_id=2 then
		if cuenta.cont > 0 then
			select into id_subchannel subchannel_id from subchannel where subchannel_name=name;
			update subchannel set subchannel_id=id_subchannel,subchannel_description=description,user_id=id_user,comm_protocol_id=protocolo.comm_protocol_id,channel_id=id_father,subchannel_modificate_date=fecha,driver_id=driver_info.driver_id, query_type=query_type where subchannel_name=name;
		else
			close $1;
			open $1 for select -1, 'Error al actualizar el subcanal '||name||', no existe', 'El subcanal no existe';
			return $1;
		end if;
	else
		close $1;
		open $1 for select -1, 'Error al configurar el subcanal '||name||, 'Accion no valida';
		return $1;
	end if;
	return $1;

EXCEPTION
	WHEN INTEGRITY_CONSTRAINT_VIOLATION OR RESTRICT_VIOLATION OR NOT_NULL_VIOLATION OR
		FOREIGN_KEY_VIOLATION OR UNIQUE_VIOLATION THEN
		open $1 for select SQLSTATE, 'Error al insertar el subcanal '||name, SQLERRM;
		return $1;
END;$_$;


